def run_length_encode(string):
    encoded = ''
    count = 1

    for i in range(0, len(string)):
        count+=1
        if count == 10:
            count = 1
            encoded += string[i]
    return encoded

# Example usage:
original_string = ""
compressed_string = run_length_encode(original_string)
print("Original String:", original_string)
print("Compressed String:", compressed_string)
